(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[2],{307:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"[symbol] feed está retrasado por [delay] minutos","[symbol] market is now opened.":"el mercado [symbol] está ahora abierto.","[symbol] market is presently closed.":"el mercado [symbol] está ahora cerrado.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Indicador técnico momentum que compara el precio de cierre de un valor con su rango de precios en un periodo determinado. La sensibilidad de un oscilador a los movimientos del mercado se puede reducir mediante el ajuste del periodo de tiempo o mediante el uso de una media móvil del resultado.","Active":"Activo","Add":"Agregar","Add new template":"Agregar nueva plantilla","Add new templates":"Agregar nuevas plantillas","All drawings":"Todos los dibujos","already exists.":"ya existe.","Area":"Área","Available only for \\\\\\"Area\\\\\\" chart type.":"Disponible solo para el tipo de gráfico \\\\\\"Área\\\\\\".","Available only for non-tick time intervals.":"Disponible solo para intervalos de tiempo sin tick.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Bill Williams introdujo el indicador Alligator en 1995. El Alligator es tanto una metáfora como un indicador. Consiste en tres líneas, superpuestas en una tabla de precios, que representan la mandíbula, los dientes y los labios del animal, y fue creado para ayudar al trader a confirmar la presencia de una tendencia y su dirección. El indicador Alligator también puede ayudar a los traders a designar impulsos y formaciones de ondas correctivas, pero la herramienta funciona mejor cuando se combina con un indicador momentum.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Las Bandas de Bollinger se pueden usar para medir el punto más alto o más bajo del precio en relación con las transacciones anteriores.","Box Size":"Tamaño de la caja","Cancel":"Cancelar","Candle":"Vela","Channel [num]":"Canal [num]","Chart data is not available for this symbol.":"Los datos del gráfico no están disponibles para este símbolo.","Chart types":"Tipos de gráficos","Charts":"Gráficos","Clear all":"Vaciar todo","CLOSED":"CERRADO","Color":"Color","Continuous":"Continuo","Continuous [num]":"Continuo [num]","CSV":"CSV","Dark":"Oscuro","day":"día","days":"días","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Williams %R es un indicador momentum, desarrollado por Larry Williams, que es el inverso del oscilador estocástico rápido. También conocido como %R, Williams %R refleja el nivel del cierre en relación con el valor máximo para el período retrospectivo.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"Aaron es un sistema de indicadores, desarrollado por Tushar Chande en 1995, que determina si el precio de un activo está en tendencia y cuál es la magnitud de esta tendencia. Está compuesto por dos indicadores separados: Aroon-Up y Aroon-down. Un Aroon-Up de 25 días mide el número de días transcurridos desde que se alcanzó un máximo, en un periodo de 25 días. Un Aroon-Down de 25 días mide el número de días transcurridos desde que se alcanzó un mínimo, en un periodo de 25 días.","Display data for a specific date and time":"Mostrar datos para una fecha y hora específicas","Display remaining time for each interval":"Mostrar el tiempo restante para cada intervalo","Display the highest and lowest spot price":"Mostrar el precio spot más alto y más bajo","Done":"Finalizado","Download":"Descargar","Drawing tools":"Herramientas de dibujo","Favorites":"Favoritos","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Los fractales son indicadores presentes en los gráficos de velas que identifican puntos de reversión en el mercado. Los traders usualmente utilizan fractales para tener una idea de en qué dirección se desarrollará un precio-. Un fractal se forma cuando un patrón particular de precios ocurre en un gráfico.","H":"H","Highest and lowest spot":"Punto más alto y más bajo","Historical data mode":"Modo de datos históricos","Hollow":"Hueco","Horizontal [num]":"Horizontal [num]","hour":"hora","hours":"horas","Indicators":"Indicadores","Interval duration":"Duración del intervalo","Kagi":"Kagi","L":"L","Language":"Idioma","Last digits stats for latest 1000 ticks on":"Estadísticas de los últimos dígitos para los últimos 1000 ticks en","Light":"Claro","Line [num]":"Línea [num]","Line Break":"Salto de línea","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"El MACD es un indicador bursátil usado en el análisis técnico de los precios de las acciones. Su objetivo es revelar cambios en la fuerza, dirección, momento y duración de una tendencia en el precio de una acción.","Markets":"Mercados","minute":"minuto","minutes":"minutos","Momentum":"","Moving averages":"","Network status":"Estado de la red","No results for":"No hay resultados para","OHLC":"OHLC","Opens in:":"Abre en:","Others":"","Overwrite":"Sobrescribir","Platform settings":"Configuración de la plataforma","PNG":"PNG","Point & Figure":"Punto & Cifra","Price Lines":"Líneas de precios","Range":"Rango","Range Bars":"Barras de rango","Ray [num]":"Ray [num]","Rectangle [num]":"Rectángulo [num]","Renko":"Renko","Reset":"Restablecer","Result":"Resultado","Retrieving Chart Data...":"Obteniendo datos del gráfico...","Retrieving Chart Engine...":"Obteniendo motores del gráfico...","Retrieving Market Symbols...":"Obteniendo símbolos de mercado...","Retrieving Trading Times...":"Obteniendo horarios de trading...","Reversal":"Reversión","Reversal Percentage":"Porcentaje de Reversión","Right click to delete":"Haga clic derecho para eliminar","Right click to manage":"Haga clic derecho para administrar","Saved templates":"Plantillas guardadas","Search...":"Buscar...","Select language":"Seleccione el idioma","Select theme":"Seleccione el tema","Settings":"Configuración","Size":"Tamaño","Streaming for [symbol] is not available due to license restrictions":"La transmisión de [symbol] no está disponible debido a restricciones de licencia","Templates":"Plantillas","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"El Índice de Promedio Direccional (ADX) fue desarrollado en 1978 por J. Welles Wilder como un indicador de la fuerza de la tendencia y en una serie de precios de un instrumento financiero ADX oscilará entre 0 y 100. En general, las lecturas de ADX por debajo de 20 indican debilidad de la tendencia y las lecturas superiores a 40 indican la fuerza de la tendencia.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"El oscilador Awesome es un indicador utilizado para medir el momentum del mercado. AO calcula la diferencia de la Media Móvil Simple de 34 periodos y la de 5 periodos. Las Medias Móviles que se utilizan no se calculan utilizando el precio de cierre, sino los puntos medios de cada barra. AO se usa generalmente para afirmar tendencias o anticipar posibles reversiones.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"El índice de canal de materias primas (CCI) es un indicador versátil que se puede utilizar para identificar una nueva tendencia o advertir sobre condiciones extremas.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"El Oscilador de Precios sin Tendencia (DPO) ayuda a identificar los ciclos de precios sin la influencia de las tendencias a corto y largo plazo. El DPO compara una media móvil simple con un precio histórico cerca de la mitad de un período específico. También muestra los picos y caídas durante ese período en particular, lo que facilita la predicción de puntos de compra.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"El Canal de Donchian es un indicador utilizado en el comercio de mercado desarrollado por Richard Donchian. Se forma tomando el mayor de los máximos y el menor de los mínimos de los últimos n períodos. El área entre lo máximo y lo mínimo es el canal para el período elegido.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"El oscilador Gator ayuda a detectar cambios de tendencia en el precio de mercado. Basado en el indicador Alligator, el Gator traza 2 histogramas a cada lado de la línea cero. La fase de sueño (ausencia de una tendencia) es cuando las barras en ambos lados son rojas. La fase de despertar (formación de una tendencia) es cuando hay barras rojas y verdes en ambos lados. Cuando hay barras verdes en ambos lados, indica la fase de alimentación (fortalecimiento de la tendencia). Una barra roja solitaria que aparece después de la fase de alimentación indica el comienzo de la fase saciada (tendencia que se acerca a su final).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"La nube Ichimoku, también conocida como Ichimoku Kinko Hyo, es un indicador versátil que define el soporte y la resistencia, identifica la dirección de la tendencia, mide el momentum y proporciona señales de trading. Ichimoku Kinko Hyo se traduce en \\"tabla de equilibrio de una mirada\\".","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"La Media Móvil (MA) ayuda a identificar la tendencia general del mercado al filtrar las fluctuaciones de precios a corto plazo. Usando datos históricos, calcula el precio promedio durante un período específico y traza una línea en el gráfico. Si la línea MA se mueve hacia arriba, es un indicador de una tendencia alcista, o una tendencia bajista si se mueve hacia abajo. Se produce una señal de compra cuando el precio se mueve por encima de la línea MA.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"La Envolvente de la Media Móvil (MAE) ayuda a identificar un fuerte movimiento de precios que indica el inicio de una tendencia. El MAE crea una línea de media móvil y 2 bandas a su alrededor. En teoría, cuando el precio de mercado toca las bandas superior o inferior, se producirá una inversión de tendencia, lo que indica una señal de compra.","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"El SAR parabólico se calcula casi de manera independiente para cada tendencia en el precio. Cuando el precio está al alza, el SAR aparece debajo del precio y converge con él de manera ascendente. De manera similar, en una tendencia bajista, el SAR aparece por encima del precio y converge con él de manera descendente. En cada paso dentro de una tendencia, el SAR se calcula con un periodo de anticipación.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"El indicador de tasa de cambio de precio (ROC) muestra la diferencia entre el precio actual y el precio de x períodos atrás. La diferencia se puede mostrar en puntos o como porcentaje.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"La Media Móvil Arcoiris (RMA) muestra varias líneas de media móvil simultáneamente. Cuando las líneas se cruzan, es un indicador de reversión de precios y el ángulo de las líneas es útil para predecir la fuerza de la tendencia. Cuanto más empinada es la curva, más fuerte es la tendencia. Cuando el precio cruza las líneas de media móvil desde abajo, indica una tendencia alcista. Cuando el precio cruza las líneas de la media móvil desde arriba, indica una tendencia bajista. La RMA es más fácil de usar en comparación con el uso de varios indicadores diferentes de media móvil a la vez.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"El índice de fuerza relativa (RSI) fue publicado por J. Welles Wilder. El precio actual se normaliza como un porcentaje entre 0 y 100. El nombre de este oscilador es engañoso, puesto que no compara el instrumento en relación con otro instrumento o un conjunto de instrumentos, sino que representa el precio actual en relación con otras piezas recientes dentro del periodo seleccionado.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"El Índice de Momentum Estocástico (SMI) ayuda a identificar condiciones de sobrecompra o sobreventa en el mercado y predecir tendencias bajistas o alcistas. Calcula la distancia entre el precio de cierre actual y la mediana del rango alto / bajo, y muestra 2 líneas en el gráfico: la primera (conocida como %K) representa el movimiento del precio, mientras que la segunda (conocida como %D) es un media móvil de la primera línea. Si el precio de cierre es más alto que la mediana del rango alto / bajo, el SMI devuelve un valor positivo. Si el precio de cierre es inferior al precio promedio, se devuelve un valor negativo. Los valores superiores a 40 indican una tendencia alcista, mientras que los valores inferiores a -40 indican una tendencia bajista.","Themes":"Temas","There are no favorites yet.":"No hay favoritos cargados.","tick":"tick","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"El intervalo de tick solo está disponible para el tipo de gráfico \\\\\\"Área\\\\\\".","Time interval":"Intervalo de tiempo","Trend":"","Trend [num]":"Tendencia [num]","Try checking your spelling or use a different term":"Intente revisar su ortografía o use un término diferente","Underlying Assets":"Activos Subyacentes","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"Hasta 5 indicadores activos permitidos.","Vertical [num]":"Vertical [num]","Volatility":"","Would you like to overwrite it?":"¿Desee sobre-escribirlo?","You have no active drawings yet.":"Aún no tiene dibujos activos.","You have no active indicators yet.":"Aún no tiene indicadores activos.","You have no saved templates yet.":"Aún no tiene plantillas guardadas.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag ayuda a identificar cambios de tendencia y filtra movimientos de precios relativamente pequeños al determinar los niveles de soporte y resistencia del mercado. Acepta un porcentaje de desviación como entrada y muestra una línea si el cambio de precio es mayor que el porcentaje de desviación. Zig Zag ignora cualquier movimiento lateral y es útil para filtrar el \\"ruido del mercado\\".","Zoom in":"Acercar","Zoom out":"Alejar"}')}}]);
